import React from "react";
import { Routes, Route, Link} from "react-router-dom";

import { MainPage } from "./pages/MainPage.js";
import { StorePage } from "./pages/StorePage.js";
import { QuestsPage } from "./pages/QuestsPage.js";
import { ReferalsPage } from "./pages/ReferalsPage.js";
import { ErrorPage } from "./pages/ErrorPage.js";

function App() {
  return (
    <div className="App">
      <ul className="navigation_menu">
        <li className="navigation_menu_component">
          <Link className="navigation_menu_link" to="/" >
            <img className="navigation_menu_image" src="" />
          </Link>
        </li>
        <li className="navigation_menu_component">
          <Link className="navigation_menu_link" to="/store" >
            <img className="navigation_menu_image" />
          </Link>
        </li>
        <li className="navigation_menu_component">
          <Link className="navigation_menu_link" to="/quests" >
            <img className="navigation_menu_image" />
          </Link>
        </li>
        <li className="navigation_menu_component">
          <Link className="navigation_menu_link">
            <img className="navigation_menu_image" />
          </Link>
        </li>
      </ul>
      <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/store" element={<StorePage />} />
        <Route path="/quests" element={<QuestsPage />} />
        <Route path="/referals" element={<ReferalsPage />} />
        <Route path="*" element={<ErrorPage />} />
      </Routes>
    </div>
  );
}

export default App;
